import React, { Component } from "react";
import { Router, Switch, Route, useRouteMatch } from "react-router-dom";

import LoginPage from "./LoginPage";
import RegistrationPage from "./RegistrationPage";
import history from './history';
import InstaTwitter from './InstaTwitter';
import Menu from './Components/Menu'
import NewUser from './Components/NewUser'
import UserProfile from './Components/UserProfile'
import CreateEditProfile from './Components/CreateEditProfile'
import HomePage from './Components/HomePage'
import Followers from './Components/Followers'
import Followings from './Components/Followings'
import OtherUserProfile from './Components/OtherUserProfile'





export default class Routes extends Component {

    constructor(props) {
        super(props)

        this.state = {
            otherUserName:localStorage.getItem('otheUserName'),
        }
    }


    components(){

        const{path}=useRouteMatch();
        return (
            <div>

                            <Route path={`${path}/NewUser/:id`} component={NewUser} />
                            <Route path={`${path}/UserProfile`} component={UserProfile} />
                            <Route path={`${path}/CreateEditProfile`} component={CreateEditProfile} />
                            <Route path="/HomePage" component={HomePage} />
                            <Route path={`${path}/Followers`} component={Followers} />
                            <Route path={`${path}/Followings`} component={Followings} />
                            <Route path={`${path}/OtherUserProfile`} component={OtherUserProfile} />


            </div>);
    }


    render() {
        return (
            <div>
            {/* <Menu /> */}
            <Router history={history}>
                <Switch>
                     <Route path="/" exact component={InstaTwitter} /> 
                    <Route path="/LoginPage" component={LoginPage} />
                    <Route path="/RegistrationPage" component={RegistrationPage} />
                    <Route  exact path="/Menu" component={Menu} > 

                        {this.components()}

                    </Route>



                </Switch>
            </Router>
            </div>
        )
    }
}
